import { Component } from '@angular/core';

@Component({
  selector: 'app-header',
  templateUrl: './header.component.html',
  styleUrls: ['./header.component.css']
})
export class HeaderComponent {
  logoImagePath = './assets/img/logo.mini.png'; 
}
<nav class="navbar x">
    <div class="container">
        <img [src]="logoImagePath" alt="Logo" class="rounded-circle logo">
        <a class="navbar-brand" href="#">
            Malimpensa Doces
        </a>
        <i class="bi bi-house"  href="#" style="font-size: 20px; font-weight: bold;  color: #8c5b65 "></i>
    </div>
</nav>
